//$inputData = str_replace(" ", "", $inputData);

$arrayInfo = explode("\n",$inputData);
$furthestLeft = 0;
foreach($arrayInfo as $key => $value) {
    $items = str_split($value);
    foreach($items as $key2 => $value2) {
        $grid[$key][$key2] = $value2;
        if($value2=='#' && $key2 > $furthestLeft) {
            $furthestLeft = $key2;
        }
    }
}

$rowCount = count($grid);
$columnCount = count($grid[0]);

if($grid[$rowCount-50][$columnCount-100]=='#' && $grid[$rowCount-150][$columnCount-100]=='#' && $grid[$rowCount-150][$columnCount-1]=='#' && $grid[$rowCount-50][$columnCount-1]=='#') {
    echo "We have a 100-square at the bottom<br>";
} else {
    $topLeft = $grid[$rowCount-135][$columnCount-100];
    $bottomLeft = $grid[$rowCount-35][$columnCount-100];
    $topRight = $grid[$rowCount-135][$columnCount-1];
    $bottomRight = $grid[$rowCount-35][$columnCount-1];
    echo "We don't have a 100 square at the bottom $topLeft :: $bottomLeft :: $topRight :: $bottomRight<br>";
}

$startX = $rowCount-138;
$endX = $rowCount-67;
$startY = $columnCount-71;
$endY = $columnCount-1;

$length = $endY - $startY;
$width = $endX - $startX;
echo "Total square that we have: $width x $length<br>";

$x = $startX;
$y = $startY;
while($x <= $endX) {
    while($y <= $endY) {
        if($grid[$x][$y]=='#') {
            $grid[$x][$y] = 'X';
        }
        $y++;
    }
    
    $y = $startY;
    $x++;
}

//printGrid($grid);

function printGrid($trackGridInputArray) {
    echo '<code>';
    foreach($trackGridInputArray as $rowID => $rowColumn) {
        foreach ($rowColumn as $columnID => $gridData){
            if($gridData==" ") $gridData = "&nbsp;";
            echo "$gridData ";
        }
        echo "<br>";
    }
    echo '</code>';
}


